description:
Spire.PDFViewer is a powerful PDF Viewer component for ASP.NET. It enables developers to load PDF document from file and view the PDF files on the web. Spire.PDFViewer is available on viewing PDF/A-1B, PDF/X1A PDF file format. PDF with basic fonts (TrueType, Type 0, Type 1, Type 3, OpenType and CJK font) are also supported. Besides, this PDF Viewer supports PDF with filled text, clipped text, and stroked text and supports PDF with lines, curve and table. Spire.PDFViewer supports DeveiceN PDF color space and DCT, JPEG2000 and CCITT Fax image formats in PDF. And it supports LZWDecode and FlateDecode. 

Main Features
• Load PDF from file and view on the web;
• Support PDF/A-1B, PDF/X1A;
• Switch to target page
• Fit page; Fit width; Fit height
• Page down/up;
• Zoom in/out;
• Hand tool;

The purpose of the project is to enable attribute routing and minimizing the code changes with switching between Nancy and ASP.NET WebAPI.

Here is some sample usage:
 [RoutePrefix("api/responseMessage")]
    public class ResponseMessageModule : ApiController
    {
        [HttpGet(nameof(WithStatusCode))]
        public ResponseMessage<Address> WithStatusCode()
        {
            var result = new Address {City = "dummie city"};
            return new ResponseMessage<Address>(() => new JsonResponse(result, new JsonNetSerializer()).WithStatusCode(HttpStatusCode.NotModified));
        }
    }

[RoutePrefix("api/userApi")]
public class UserApi : ApiController
{       
    [HttpGet("/")]
    public IEnumerable<User> GetAll()
    {
        return new List<User> { new User(), new User() };
    }


    [HttpGet("/{id}")]
    public User GetById(int id)
    {
        return new User();
    }
}
